tables.table_schema:
CREATE TABLE ImageProcessingJobs (
    job_id INT PRIMARY KEY,
    image_url TEXT NOT NULL,
    status VARCHAR(50) NOT NULL,
    result TEXT
);

CREATE TABLE JobLogs (
    log_id INT PRIMARY KEY,
    job_id INT REFERENCES ImageProcessingJobs(job_id),
    log TEXT NOT NULL,
    timestamp TIMESTAMP NOT NULL
);

CREATE TABLE JobMetrics (
    metric_id INT PRIMARY KEY,
    job_id INT REFERENCES ImageProcessingJobs(job_id),
    metric_name VARCHAR(50) NOT NULL,
    metric_value FLOAT NOT NULL
);

CREATE TABLE image_jobs (
    job_id SERIAL PRIMARY KEY,
    image_url VARCHAR(255) NOT NULL,
    job_status VARCHAR(50) NOT NULL,
    job_result JSONB
);

CREATE TABLE image_results (
    result_id SERIAL PRIMARY KEY,
    job_id INT REFERENCES image_jobs(job_id),
    result_data JSONB NOT NULL,
    result_timestamp TIMESTAMPTZ NOT NULL
);

CREATE TABLE pipeline_logs (
    log_id SERIAL PRIMARY KEY,
    log_timestamp TIMESTAMPTZ NOT NULL,
    log_message TEXT
);

CREATE TABLE ImageJobs (
    job_id UUID PRIMARY KEY,
    job_name VARCHAR(50) NOT NULL,
    job_status VARCHAR(20) NOT NULL,
    created_at TIMESTAMP NOT NULL
);

CREATE TABLE PipelineStatus (
    status_id UUID PRIMARY KEY,
    pipeline_name VARCHAR(50) NOT NULL,
    pipeline_status VARCHAR(20) NOT NULL,
    last_execution TIMESTAMP NOT NULL
);
